import React from 'react';
import { motion } from 'framer-motion';
import './Process.css';

const Process = () => {


  return (
    <div className="process">

      <div className="p-left">

       <div className="element brief">
         <span>1</span>
         <span>Briefing</span>
         <span>Send me a detailed brief of the problem statement.</span>
       </div>

       <div className="element wireframe">
         <span>3</span>
         <span>Wireframing</span>
         <span>Designing the logical structure of the future UI based on research and structure from the customer.</span>
       </div>

       <div className="element high">
         <span>5</span>
         <span>High-Fidelity Prototyping</span>
         <span>Design the high-fidelity prototype which will be similar to your final developed product.</span>
       </div>

      </div>

      <div className="p-right">

      <div className="element research">
         <span className='num'>2</span>
         <span className='name'>Research</span>
         <span className='describe'>Development Begins with competitive and visual analysis, target audience and market research.</span>
      </div>

      <div className="element testing">
          <span className='num'>4</span>
         <span className='name'>Testing</span>
         <span className='describe'>Starting with research plan , I will conduct usability study, and then find out themes and insights.</span>
      </div>

      <div className="element support">
       <span className='num'>6</span>
       <span className='name'>Transferring Files & Support</span>
       <span className='describe'>Prepare a design file with a fully developed project, including adaptive versions and all the necessary material to give to your developer.</span>
      </div>


      </div>
    </div>
  );
};

export default Process;


